import moment from "moment";
import _ from "underscore";

export interface GroupEntity {}

export default (entities: any) => {
  var groups = _.groupBy(entities, function (entity: any) {
    moment(entity.lastUpdated).startOf("day").format();
  });
  return groups;
};
